import React from 'react'
import { Button } from '../buttons/Button/Button'

export type NoResultsProps =
  | {
      clearFilters: () => any
      label?: string
      clearFilersLabel?: string
    }
  | {
      label?: string
      disableClearFilters?: boolean
    }

const NoResults = (props: NoResultsProps) => {
  const { clearFilters, label, disableClearFilters, clearFilersLabel } = {
    clearFilters: null,
    label: '',
    clearFilersLabel: null,
    disableClearFilters: null,
    ...props,
  }
  return (
    <section className="no-result">
      <div>
        <svg width="122" height="122" viewBox="0 0 122 122" fill="none" xmlns="http://www.w3.org/2000/svg">
          <rect width="122" height="122" fill="url(#pattern0)" />
          <defs>
            <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
              <use xlinkHref="#image0_1274_9403" transform="scale(0.00195312)" />
            </pattern>
            <image
              id="image0_1274_9403"
              width="512"
              height="512"
              xlinkHref="data:image/png;base64,"
            />
          </defs>
        </svg>
      </div>
      {label ? label : 'Kein Ergebnis gefunden'}
      {!disableClearFilters && clearFilters && (
        <Button
          onClick={clearFilters}
          label={clearFilersLabel ? clearFilersLabel : '— Alle Filter entfernen'}
          type="secondary"
          className="mt-4"
        />
      )}
    </section>
  )
}

export default NoResults
